def get_keywords():
    with open('D:/Git Uploads/team-9-case-study/backend_api/ESG_Keywords.txt') as f:
        lines = f.readlines()
    words = []
    for line in lines:
        words.append(line.replace("\n",""))
    words.remove('## Extended ##')
    words.remove('## Basic ##')
    return words


def preprocess_text(text):
    text = re.sub(r'[^\w\s-]', '', text)
    text = text.lower()
    tokens = text.split()
    stemmer = nltk.stem.PorterStemmer()
    stemmed_tokens = {stemmer.stem(token) for token in tokens}
    return stemmed_tokens


def generate_root_keywords(words):
    stemmed_words = {}   #Dict
    root_keywords = []   #List
    for word in words:
        prepro_word = preprocess_text(word)
        stemmed_words[word] = prepro_word
        for ele in prepro_word:
            root_keywords.append(ele)
    return stemmed_words,root_keywords


