def datastore_jai_radial_get(input_passed,kind_passed="Data_Radial_Gauge_Chart"):
    """
    This GET request will return all the texts and sentiments that have been POSTed previously.
    """
    # Create a Cloud Datastore client.
    kind_passed = "Data_Radial_Gauge_Chart"
    datastore_client = datastore.Client()
    query = datastore_client.query(kind=kind_passed)
    text_entities = list(query.fetch())
    scores = {}
    for ele in text_entities:
        scores[ele["bank_name"]] = float(ele[input_passed])
    return scores


def create_radial_gauge_chart(key, val, scores):
    fig = go.Figure(go.Indicator(
    domain = {'x': [0, 1], 'y': [0, 1]},
    value = val,
    mode = "gauge+number+delta",
    title = {'text': key},
    delta = {'reference': scores["Deutsche Bank"]},
    gauge = {'axis': {'range': [0, 5]},
            'bar': {'color': "#4c8bf5"},
            'steps' : [{'range': [0, 1.5], 'color': "#de5246"},{'range': [1.5, 3], 'color': "#ffce44"},{'range': [3, 5], 'color': "#1aa260"}]}
            ))
    return fig


def plot_radial_gauge(scores):
    fig = make_subplots(rows=1, cols=5,
                        specs=[[{"type": "indicator"}, {"type": "indicator"},{"type": "indicator"},{"type": "indicator"}, {"type": "indicator"}]])
    row = 1
    col = 1
    gauge_chart = create_radial_gauge_chart('Deutsche Bank', scores['Deutsche Bank'], scores)
    # fig.add_trace(gauge_chart.data, row=row, col=col)
    for trace in gauge_chart.data:
            fig.add_trace(trace, row=row, col=col)
    col+=1
    for key,value in scores.items():
        if key=='Deutsche Bank':
            continue
        gauge_chart = create_radial_gauge_chart(key, value, scores)
        for trace in gauge_chart.data:
            fig.add_trace(trace, row=row, col=col)
        col += 1

    # Update layout for better visualization
    fig.update_layout(
        height=300,
        width=1200
        # title_text="Radial Gauge Charts"
    )

    # fig.show()
    return fig
    
